function server_request_mock(command, body, resolve, reject) {
	if (!sr_apiLoaded) {
		if (sessionStorage.getItem('all_data'))
			window.all_data = JSON.parse(sessionStorage.getItem('all_data'));
		
		if (sessionStorage.getItem('static_data'))
			window.static_data = JSON.parse(sessionStorage.getItem('static_data'));
		window.all_api.init({
			admin_login: "admin",
			admin_password: "test"
		});
		
		sr_apiLoaded = true;
	}
	
	if (!reject) {
		reject = function f(s){
			alert(s);
		}
	}
	
	window.all_api.do_request({
		command: command,
		data: body===undefined?0:body,
		...sr_default_varible
	}, (response) => {
		sessionStorage.setItem('all_data', JSON.stringify(window.all_data));
		sessionStorage.setItem('static_data', JSON.stringify(window.static_data));
		setTimeout(()=>{
			if (response.error) {
				reject(response.error);
			} else {
				resolve(response.data);
			}
		});
	});
	return;
	
}
 